('news', 0, 1, 1, 'en', 0, '<p>IIM Indore, boasting of the biggest batch across IIMs with 562 PGP and IPM participants has wrapped up summer placements for the class of 2017.</p>\r\n\r\n<p>The average stipend for the batch stood at INR 91,000 for 8 weeks, an increase of 28% over the last year. Marquee recruiters Asian Paints, Kellogg’s, Mapro Foods and Microsoft returned to the campus along with Bharti AXA, EMC Corporation, Sarda Group and Xerox India visiting for the first time. The highlight of this year was a significant increase in the number of roles and offers by each company.</p>\r\n\r\n<p>The highest stipend was INR 3 lakhs (for 8 weeks), offered by The Boston Consulting Group and a leading private equity firm. BCG, Cognizant Business Consulting, Deloitte S&amp;O, RedSeer Consulting, TCS were some of the prominent recruiters in the Consulting domain.</p>\r\n\r\n<p>BFSI domain witnessed offers from investment banks like Deutsche Bank, Edelweiss, Goldman Sachs, J P Morgan, whose combined offer count was more than 40. American Express, Arcesium, Axis Bank, CRISIL, Fidelity Investments, HSBC, ICICI Bank were the other big names. The above firms offered diverse roles ranging from Investment Banking, Equity Research, Credit Analysis, Retail Banking and Risk Management. Investment Associate role was offered by a Private Equity company.</p>\r\n\r\n<p>Sales and Marketing remained one of the most preferred domains amongst the participants with big brands like Asian Paints, Britannia, Dabur, HUL, ITC, Kellogg’s, L’Oréal, Marico, PepsiCo, Philips, Pidilite, Raymond, Tata Steel, Tolaram Group, Vodafone expressing their faith in the marketing talent at IIM Indore. Other prominent recruitment partners include Genpact, GSK Pharma, HT Media and Multi Screen Media.</p>\r\n\r\n<p>Aditya Birla Group, Airtel, JSPL, L&amp;T, Mahindra &amp; Mahindra, Reliance Industries Limited, Robert Bosch offered General Management roles. Operations domain was strengthened by significant increase in offers from Adani Wilmar, Cummins India, Maersk, Philips and Vodafone.</p>\r\n\r\n<p>Technology and IT firms thronged the campus with General Electric, HUL, EMC Corporation offering coveted leadership roles and Microsoft recruiting for their sought after Program Management role. Mindtree and Xerox offered Product Management roles while Capgemini, IBM, Mahindra Comviva, TCS, Wipro recruited for a wide range of roles. Analytics domain continued its strong emergence with increasing number of offers being rolled out by American Express, eBay, Google, Tiger Analytics, to name a few. Infibeam, Purplle and Snapdeal were a few other prominent names under the ecommerce sector.</p>\r\n\r\n<p>This year saw funded and Nasscom 10000 list start-ups participating in the process and offering diverse roles in Business Development, Digital Marketing, Market Research amongst others. The second batch of Integrated Programme in Management that appeared for summer placements witnessed participation by leading recruiters like Adani Wilmar, AkzoNobel, Britannia, Deloitte S&amp;O, Genpact, HUL, ICICI, JP Morgan, L’Oreal, Mahindra &amp; Mahindra, to name a few.</p>\r\n\r\n<p>“The summer placement process of the 2015-17 batch, with a marked improvement in the number of first time recruiters, profiles offered and stipend has been testimonial to the faith in the institute’s course pedagogy and quality of students. I thank the recruiters for actively</p>\r\n\r\n<p>participating and offering internships to our PGP and IPM participants.”- Prof. Rishikesha T Krishnan, Director, IIM Indore.</p>\r\n', '', 'full_html'),
('news', 0, 2, 2, 'en', 0, '<p>The most popular Annual Sports Fest of IIM Indore, Ranbhoomi; organized by the participants of Integrated Programme in Management (IPM) would be held at the Institute from February 5-7, 2016. The word&nbsp;<em>‘Ranbhoomi’&nbsp;</em>truly captures the essence of any competitive sport. It is about the challenge, the war, the performance in the war, the rules, the ethics, the spirit and all that contributes to culminate into a healthy competition where one desires victory, in its every form. The second edition of this exciting fest is likely to draw the best sports persons from prestigious colleges across the nation.</p>\r\n\r\n<p><img alt="Ranbhoomi" data-align="left" data-entity-type="file" data-entity-uuid="7f7af195-7810-4ac9-afeb-0b308f765455" src="/iimisac-d8/sites/default/files/inline-images/Ranbhoomi-400x225.jpg" />&nbsp;&nbsp;Annually held, the three-day event this year will again witness more than 20 sporting events – ranging from the popular – Cricket, Football, Basketball, Lawn tennis, Volleyball &amp; Chess to the unusual including Arm wrestling,&nbsp; Street Football, Gully Cricket, Foosball and much more. Flagship events like Triathlon, Power Lifting and Swimming will also be included in the competition.</p>\r\n\r\n<p>Apart from the sport events and various informal events; the highlight of the fest would be a Mega Night on the last day; February 7, 2016. The last day will have a&nbsp;<em>‘Fight for Glory Campaign’&nbsp;</em>to bring to light the suffering sports persons; which would also include a footfall of over 8000 and participation from over 80 colleges. As a major highlight, the Guest of Honor for this event will be&nbsp;<strong>Mr. Gautam Gambhir</strong>,&nbsp;the much loved cricketer of our Indian Cricket Team.</p>\r\n\r\n<p><img alt="Ranbhumi2" data-align="right" data-entity-type="file" data-entity-uuid="5f50ed82-237e-4c6e-bedd-4babd9da93fc" src="/iimisac-d8/sites/default/files/inline-images/Ranbhoomi1-400x225.png" /></p>\r\n\r\n<p>Each event promises to bring together the best talent from across the nation, and thus the fest brings three days of a pure, unadulterated sporting experience for its participants.</p>\r\n\r\n<p>So the pitch is all set, the battleground awaits its participants at Ranbhoomi ’16.</p>\r\n\r\n<p><em>Interested participants can register at&nbsp;</em><a href="http://www.ranbhoomi.com/"><em>www.ranbhoomi.com</em></a><em>.</em></p>\r\n', '', 'full_html'),
('news', 0, 3, 3, 'en', 0, '<p>The Social Sensitivity Cell of IIM Indore Pragat-I visited the schools adopted by the Institute on December 22, 2015 and January 19, 2016. The schools namely Government Girls Primary School-Umaria, Government Primary School -Nawada, Government EG School -Pigdamber and Government Primary &amp; Middle School, Shramik Colony-Rau are adopted by the Institute as a part of School Adopted Programme. During this visit, the members of Pragat-I and a few staff members of the Institutes distributed school bags and sweaters to the students. A total of 430 students in these schools benefitted from this activity.</p>\r\n\r\n<ul>\r\n	<li><img alt="Pragat-I-Jan16-1" height="296" src="http://www.iimidr.ac.in/wp-content/uploads/Pragat-I-Jan16-1-400x296.jpg" width="400" /></li>\r\n	<li><img alt="Pragat-I-Jan16-4" height="296" src="http://www.iimidr.ac.in/wp-content/uploads/Pragat-I-Jan16-4-400x296.jpg" width="400" /></li>\r\n	<li><img alt="Pragat-I-Jan16-3" height="296" src="http://www.iimidr.ac.in/wp-content/uploads/Pragat-I-Jan16-3-400x296.jpg" width="400" /></li>\r\n</ul>\r\n', '', 'full_html'),
('forum', 0, 4, 4, 'en', 0, '<p>Hi Guys,</p>\r\n\r\n<p>I am looking for some tips from all of you for this recruitment drive.&nbsp;</p>\r\n', '', 'basic_html'),
('notice_board', 0, 5, 5, 'en', 0, '<p><strong>INTRODUCTION</strong></p>\r\n\r\n<p>The doctoral fraternity of Indian Institute of Management Indore, committed to creation and dissemination of knowledge, takes immense pride and joy in inviting you to the 7th annual “Conference on Excellence in Research and Education (CERE)” to be held from 5th – 8 th May, 2016 at the premises of the institute at Indore. The three day conference will also include Paper/Poster Presentation, Doctoral Colloquium and Workshop by eminent faculty members to encourage young researchers in the field of management.</p>\r\n\r\n<p>The objective of the conference is to promote, propagate, and diffuse wisdom pertaining to management and auxiliary disciplines that have the potential to transform the world of academia and practitioners. This conference aims to invigorate geniuses of myriad backgrounds with curiosity and to facilitate active participation in the perpetual voyage of knowledge creation. It provides us with a platform to solemnize the searches for newer horizons of knowledge and to felicitate the sincere endeavors in this respect. In order to propel the spirit of exploration, the conference also encourages enabling exchange of views, nurturing of research potential, and identifying emerging areas etc. It also aims at instilling aspiration among budding researchers who want to make an impact. It will provide the participants a panoramic glimpse of the contemporary management research in India against the global backdrop.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Highlights of the conference</strong></p>\r\n\r\n<ul>\r\n	<li>1<sup>st</sup>&nbsp;Day- Keynote Address by&nbsp;<strong>Sougata Ray, Professor, Strategic Management , IIM-Calcutta</strong></li>\r\n	<li>3<sup>rd</sup>&nbsp;Day – Keynote Address by&nbsp;<strong>Phanish Puranam, Professor, Strategy and Organization Design, INSEAD, Singapore</strong></li>\r\n	<li>Workshop on Academic Writing by&nbsp;<strong>Charles Dhanaraj, Professor, Strategy and Global Leadership IMD, Switzerland</strong></li>\r\n	<li>Workshop on&nbsp;<strong>Critical Management Studies</strong></li>\r\n	<li>Doctoral Colloquium</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a name="Key_Dates"></a>Key Dates</strong></p>\r\n\r\n<p>Submission of Full Paper Opens: 15<sup>th</sup>&nbsp;January, 2016</p>\r\n\r\n<p>Submission Closes: 15<sup>th</sup>&nbsp;February, 2016</p>\r\n\r\n<p>Paper acceptance confirmation: 15<sup>th</sup>&nbsp;March, 2016</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a name="Venue"></a>Venue</strong></p>\r\n\r\n<p>The venue for the conference is the picturesque, hilltop campus of the Indian Institute of Management Indore, in the heart of Central India. In addition to well-equipped classrooms and seminar halls, there are excellent sports facilities, including an Olympic size swimming pool and state-of-the-art gymnasiums. Indore is well-connected to all major cities of India and abroad by air, road and railways, and boasts of several tourist attractions in its surrounding areas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a name="contact"></a>Contact Us</strong></p>\r\n\r\n<p>For any queries related to the conference kindly mail&nbsp;<b><a href="mailto:cere2016@iimidr.ac.in" target="_blank">cere2016@iimidr.ac.in</a></b></p>\r\n\r\n<p><strong>Coordinator</strong></p>\r\n\r\n<p>Pooja Batra&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (+91 9431704771)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; e-mail:&nbsp;<a href="mailto:f15poojab@iimidr.ac.in">f15poojab@iimidr.ac.in</a></p>\r\n\r\n<p><strong>Abstract &amp; Papers</strong></p>\r\n\r\n<p>Suganya Balakumar&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(+91 8056107533)&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;e-mail:&nbsp;<a href="mailto:f15suganyab@iimidr.ac.in">f15suganyab@iimidr.ac.in</a></p>\r\n\r\n<p><strong>&nbsp;Travel &amp; Accommodation</strong></p>\r\n\r\n<p>Deepak Ranjan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (+91 9608096927)&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;e-mail:&nbsp;<a href="mailto:f15deepakr@iimidr.ac.in">f15deepakr@iimidr.ac.in</a></p>\r\n\r\n<p><strong>Point of Contact for Foreign Delegates</strong></p>\r\n\r\n<p>Kakul Modani &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(+91 9893264344)&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;e-mail:&nbsp;<a href="mailto:f15kakulm@iimidr.ac.in">f15kakulm@iimidr.ac.in</a></p>\r\n', '', 'full_html'),
('notice_board', 0, 6, 6, 'en', 0, '<h4><strong>India: The Next Decade</strong></h4>\r\n\r\n<h5><strong>About The Conference</strong></h5>\r\n\r\n<p>The third Pan-IIM World Management Conference at IIM Indore offers an exciting opportunity for professionals, academicians, policy-makers and thought leaders to share their contributions in various disciplines of management, preview current research, initiate collaborative efforts, and grow professional networks. Spurred on by the success of the conferences in Goa (2013) and Kozhikode (2014), the Indian Institutes of Management have once again come together to create a forum where the best minds from India and across the world can map the future course of management thought and practice. The three day conference, organized with support from the Ministry of Human Resource Development, Government of India, promises a rich mix of research presentations, invited lectures, workshops and plenary sessions. The resultant synergy is sure to set the tone for a slew of forward thinking ideas.</p>\r\n\r\n<p><strong>Growth and Development in a Fast-Changing Global Environment</strong></p>\r\n\r\n<p>The last few decades have seen India emerge as one of the fastest growing economies in the world. Companies from the Indian IT/ITES sector are recognized worldwide for their quality and delivery, and India is the preferred destination for technology outsourcing. Prime Minister, Shri Narendra Modi’s recent call to “Make in India” has enthused the industry and focused attention on strengthening the manufacturing sector through innovation and productivity enhancement.</p>\r\n\r\n<p>India remained insulated from the aftershocks of the recent recession stimulating interest in the strength of the Indian domestic market and the monetary management practices adopted by India. With growth in its semi-urban and rural markets signalling a robust growing economy and acceleration in e-commerce adoption redefining markets, India is on the threshold of introducing new models of sustainable development. The new models of sustainable development can address the demand for new approaches in dealing with problems arising from widening regional differences and inter-country disputes.</p>\r\n\r\n<p>Industries and firms across the world are in a state of flux-with established large companies re-inventing themselves to compete with nimble small companies that dominate new technology arenas. For countries as well as firms, the strategies of yesteryears may not be appropriate in the next decade which calls for new strategies, paradigms and practices. Our focus, therefore, is on new practices and policies for growth in a Volatile, Uncertain, Complex and Ambiguous (VUCA) environment with a special emphasis on India.</p>\r\n\r\n<h5><strong>CALL FOR PAPERS</strong></h5>\r\n\r\n<p>Submissions of conceptual/empirical research papers in management and allied disciplines are invited from academicians, students and practitioners for oral and poster presentations. Authors are encouraged to submit papers on the conference theme and the following sub themes from any functional perspective.</p>\r\n\r\n<h5><strong>Sub-Themes</strong></h5>\r\n\r\n<ul>\r\n	<li>Competitiveness in Manufacturing and Services</li>\r\n	<li>Economic Growth, Development &amp; Inclusiveness</li>\r\n	<li>International Trade and Investments</li>\r\n	<li>Financial and Capital Markets</li>\r\n	<li>Regulation</li>\r\n	<li>Risk Management for Countries, Regions and Firms</li>\r\n	<li>Emerging Forms of Businesses and Industries</li>\r\n	<li>Strategies for Growth in an Uncertain Environment</li>\r\n	<li>Leadership for the Enterprise of Tomorrow</li>\r\n	<li>People Management in and Uncertain World</li>\r\n	<li>Entrepreneurship and Innovation</li>\r\n	<li>Ethical Business Practices and Corporate Governance</li>\r\n	<li>Corporate Social Responsibility</li>\r\n	<li>Global Operations and Sustainability</li>\r\n	<li>Communication Challenges in Multicultural Organizations</li>\r\n	<li>Engaging with the Consumer in a Digital World</li>\r\n	<li>E-Governance</li>\r\n</ul>\r\n\r\n<p><strong>Special Interest Group Tracks:</strong>&nbsp;IIM Indore has launched Special Interest Groups in particular areas of interest to provide faculty and students a forum for collaborative knowledge creation and research. We invite research papers pertaining to the following Special Interest areas:</p>\r\n\r\n<ol>\r\n	<li>Rejuvenating MSMEs</li>\r\n	<li>Doing Business in China and India</li>\r\n	<li>The Aviation Industry</li>\r\n	<li>Frugal and Inclusive Innovation</li>\r\n	<li>Economic and Social Development at the Regional level</li>\r\n</ol>\r\n\r\n<p>The sub-themes mentioned above are only indicative in nature and authors are encouraged to submit papers on topics that dovetail with the theme of the conference. Papers not directly related to the conference theme, but representing cutting-edge management thinking or research methods, are also welcome. A maximum of three papers (single authored/co-authored) may be submitted by a participant. All papers will be subject to blind peer review before acceptance.</p>\r\n\r\n<h5><strong>AWARDS</strong></h5>\r\n\r\n<p>Selected papers will be considered for awards in the Best Paper, Best Doctoral Student Paper and Best Poster Presentation categories. Selected papers will also be considered for publication in a peer-reviewed special issue of the Indore Management Journal. Extended abstracts of all papers will be made available as part of the conference proceedings.</p>\r\n', '', 'full_html'),
('notice_board', 0, 7, 7, 'en', 0, '<h2>Introduction</h2>\r\n\r\n<p>Aimed at enhancing research and teaching capabilities of management educators, IIM Indore’s FDP is a 5-week residential programme, specially designed for faculty members of management education and training institutes. The programme enables the participants to develop competence in understanding recent advances in management research, to learn to improve pedagogies and to better presentation skill to become an effective management faculty.</p>\r\n\r\n<h2>Programme Design</h2>\r\n\r\n<p>The primary thrust of the 5-week programme will be to equip the participants with contemporary research and teaching skills. Emphasis will also be given to understanding of philosophy of management, design and development of learning resources and so on. The course would contain following modules:</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Module 1</td>\r\n			<td>Case and Teaching Skill Development</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Module 2</td>\r\n			<td>Research Methodology</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Module 3</td>\r\n			<td>Research Skill Development</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Module 4</td>\r\n			<td>Perspectives on Management</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>For more details, please contact:</p>\r\n\r\n<p>FDP Office (0731-2439616, 549) or email at&nbsp;<a href="mailto:fdp@iimidr.ac.in">fdp@iimidr.ac.in</a></p>\r\n', '', 'full_html'),
('news', 0, 8, 8, 'en', 0, '<p>A cyclone-predicting satellite being built by ISRO scientists at the Space Applications Centre (SAC) in Ahmedabad could be cited as an example of “frugality”. The new weather satellite — being built at 60 per cent of the actual cost and in one-third of the stipulated time — is set to replace OceanSat-2 that had accurately predicted cyclones like Hudhud and Phailin.</p>\r\n\r\n<p>About 40 per cent parts of this 310 kg satellite, ScatSat-1, which is expected to be launched in July 2016, are literally “leftovers” from previous satellite missions that have been built at the SAC. “Normally, it takes about three years to build a satellite of this class from scratch. However, as we have sourced 40 per cent of the parts used in ScatSat-1 from spares of previous missions, we will complete it in a year’s time,” said Tapan Misra, director of the SAC, an important arm of ISRO that deals with a wide variety of disciplines comprising of design and development of payloads, societal applications, capacity building and space sciences.</p>\r\n\r\n<p>“Also, there is a substantial reduction in the cost of building the satellite. We are at least saving 60 per cent of the total cost. That’s not all. When launched in July, ScatSat-1 will be piggy-ride with another satellite, thus saving us the launch costs as well,” said Misra, without divulging the cost of the new weather satellite. ScatSat-1 is set to replace OceanSat-2, which was launched in 2009 and had become dysfunctional in 2014. “OceanSat-2 was famous for its accurate predictions of cyclones like Hudhud and Phailin. Currently, we are getting most of our weather data from the INSAT-3D satellite,” he said.</p>\r\n\r\n<p>The new satellite will also have a scatterometer to help it predict cyclogenesis or the formation and strengthening of cyclones in the seas. “It will measure wind vectors, including the direction and speed of wind over seas and oceans. This satellite has also been built to withstand multiple system failures, unlike the previous weather satellites that were designed for a single failure,” Misra added. ScatSat-1 will have a mission-life of five years and hold fort for ISRO till a more advanced OceanSat-3 is built. This polar orbiting satellite will take two days to cover the globe and is expected to provide data to other nations.</p>\r\n\r\n<p>- See more at: http://indianexpress.com/article/cities/ahmedabad/isro-scientists-in-ahmedabad-uses-spares-for-weather-satellite-to-save-cost-and-time/#sthash.zjbpdVcw.dpuf</p>\r\n', '', 'full_html'),
('news', 0, 9, 9, 'en', 0, '<p>Scientists, including one of Indian-origin, have proposed a new set of cosmic chemical reactions involving methanol that may have led to the creation of the first building blocks of life on Earth.</p>\r\n\r\n<p>How life began is one of the most fundamental questions scientists puzzle over. To address it, they have to look not just back to the primordial Earth, but out into space.</p>\r\n\r\n<p>Through experiments and calculations, the scientists, including Surya Prakash of University of Southern California, demonstrated that methanol can give rise to varied hydrocarbons, their derivatives and products, including their ions (carbocations and carbanions), which have been observed in outer space.</p>\r\n\r\n<p>The scientists believe that when these hydrocarbons and other products were transported to Earth by asteroids or comets, they continued to evolve in the planet’s unique “goldilocks” conditions – liquid water, a breathable atmosphere and moderate temperatures – ultimately leading to life as we know it.</p>\r\n\r\n<p>In the earliest minutes of the universe’s formation, from the energy of the Big Bang, hydrogen and helium formed. All of the other elements developed later in the hot interiors of new stars through the nucleochemical transformation of hydrogen into carbon, nitrogen, oxygen and others.</p>\r\n\r\n<p>A few million years later, supernova explosions in these stars flung elements into the surrounding space, forming water and hydrocarbons – compounds containing carbon and hydrogen such as methane and methanol.</p>\r\n\r\n<p>How more complex hydrocarbons evolved, including those that would eventually lead to life on Earth, remains an open question.</p>\r\n\r\n<p>Some astrophysicists propose that they all came from methane, which is composed of one carbon atom and four hydrogen atoms.</p>\r\n\r\n<p>The researchers found that methanol, an abundant derivative of methane and better known on Earth as “wood alcohol,” is more reactive than methane itself.</p>\r\n\r\n<p>The research was published in the Journal of the American Chemical Society.</p>\r\n', '', 'full_html'),
('news', 0, 10, 10, 'en', 0, '<p>Would you edit the genome of your future to child? For many people, the initial impulse might lead you to say no, based on the idea that any benefits could be outweighed by the risks. But considering certain classes of genetic conditions, it’s possible that one’s perspective might change.</p>\r\n\r\n<p>It has been almost four years since researchers first demonstrated that clustered regularly-interspaced short palindromic repeats and associated an endonuclease (together known as the CRSPR/CAS system) could be used for genome editing. Since that time media discussions of the prospect of utilizing these tools to edit the genomes of human embryos have been influenced heavily by the idea that we should hold off on “designer babies.”&nbsp;Critics suggest that it’s too dangerous; the human genome and gene expression is extremely complex such that meddling could lead to unpredictable consequences.</p>\r\n\r\n<p>Despite these concerns, researchers are moving forward with attempts to make edits to human embryos using CRISPR and other genome editing techniques. On February 1,&nbsp;<a href="https://www.geneticliteracyproject.org/2016/02/01/regulators-give-uk-scientists-green-light-to-genetically-modify-human-embryos/" target="_blank">regulators&nbsp;in the United Kingdom</a>&nbsp;announced they would allow these times of edits to be done by scientists&nbsp;at the Francis Crick Institute in London. The goal of this research&nbsp;is to learn more about the early stages of human life and will not involved implantable embryos. But many are beginning to wonder&nbsp;not<em>if</em>&nbsp;human embryonic&nbsp;genome editing on implantable embryos, which could produce heritable changes to the genome, but&nbsp;<em>when</em>&nbsp;will it happen. However, recent examples suggest that if they do occur the edits&nbsp;may not be as drastic as some are concerned they will be.</p>\r\n\r\n<p><strong>Chinese researchers already accomplished editing of human embryo</strong></p>\r\n\r\n<p>Based on a&nbsp;cautious perspective, Chinese researchers received strong criticism from around the planet last year for demonstrating that they could edit genomes of 86 human zygotes, even though the zygotes used were not viable. There was no chance that they’d ever be used in a pregnancies going to term, so arguably there was no ethical issue.&nbsp;<a href="http://link.springer.com/article/10.1007/s13238-015-0153-5/fulltext.html" target="_blank">Published in the journal&nbsp;<em>Protein and Cell</em></a>, the Chinese study was a scientific success. The researchers showed that they could replace a defective DNA sequence causing beta-thalassemia. Theoretically, doing the same thing in viable embryos would result in a cure for such a recessive disease. If taken to term, such an embryo would produce a child with normal hemoglobin, despite having received defective genes from both parents.</p>\r\n\r\n<p>Of course, there are other ways to prevent birth of a child with a recessive disease. If an embryo can be tested in the first place to reveal two defective copies of the gene for the hemoglobin beta chain in the first place, then the same embryo can be discarded and the parents can try for a new embryo. After all, two carriers of the mutation have only a 25 percent chance of producing such an diseased embryo. Surely, say critics, screening and discarding embryos is less risky than meddling with an embryonic genome.</p>\r\n\r\n<p>That may be a reasonable position, but the Chinese study was still a remarkable accomplishment scientifically. It has potential clinical benefits that should have figured prominently in media coverage, but weren’t. On the normally progressive<a href="http://www.npr.org/sections/health-shots/2015/04/23/401655818/critics-lash-out-at-chinese-scientists-who-edited-dna-in-human-embryos" target="_blank">NPR,</a>&nbsp;for instance, coverage was skewed in favor of genetics experts who spoke only of the dangers.</p>\r\n\r\n<p>“No researcher should have the moral warrant to flout the globally widespread policy agreement against modifying the human germline,” said Marcy Darnovsky of the&nbsp;<a href="http://www.geneticsandsociety.org/index.php">Center for Genetics and Society</a>, for instance, in a quote highlighted by the NPR story. “This paper demonstrates the enormous safety risks that any such attempt would entail, and underlines the urgency of working to forestall other such efforts. The social dangers of creating genetically modified human beings cannot be overstated.”</p>\r\n\r\n<p>Another expert cited in the story, George Daley of Harvard, said “We should brace for a wave of these papers, and I worry that if one is published with a more positive spin, it might prompt some [in vitro fertilization] clinics to start practicing it, which in my opinion would be grossly premature and dangerous.”</p>\r\n\r\n<p>The NPR story did not balance such warnings with an appreciation for the potential of such research to lead to life saving therapies, even far into the future. Moreover, media have been&nbsp;<a href="https://www.geneticliteracyproject.org/2015/04/23/ethical-and-science-conundrum-did-reporters-scientists-miss-nuances-of-embryo-gene-editing-story/" target="_blank">taking a similar approach</a>&nbsp;to the topic over the last two years, as if there were no experts to quote who could provide a less alarmist perspective, but such experts do exist.</p>\r\n\r\n<p><strong>CRSPR/CAS game changer in biomedicine: Are stories about designer babies missing the boat?</strong></p>\r\n\r\n<p>The Chinese embryonic editing study notwithstanding, genome editing technology is currently being used and envisioned for a host of applications less ambitious than embryo tampering, but exciting for biomedicine nevertheless. Beyond numerous research applications that are helping molecular biologists to discover new drugs and other interventions, CRISPR technology is also being studied for modifying stem cells that can be used for all sorts of treatments. It also will be used in vivo in adult humans, probably first in blood conditions since&nbsp;<em>in vivo</em>&nbsp;(as well as<em>&nbsp;in vitro</em>) modification of blood cells is inherently much easier than than editing sequences within cells of solid tissues. Compared with these applications, the prospect of using embryonic modification clinically lies further into the future, making media coverage focussing on human embryonic modification appear premature.</p>\r\n\r\n<p><strong>Early gene editing of embryos would not make major changes</strong></p>\r\n\r\n<p>Nobody is arguing today that gene editing technology for human embryos is ready for clinical applications; in fact, several scientists who work with the technology are calling for a moratorium on CLINICAL USE of its embryonic applications. This camp includes co-discoverer of CRISPR/CAS-9 (the particular CRISPR/CAS that occurs naturally in the bacterial species&nbsp;<em>Streptococcus pyogenes</em>) Jennifer Doudna of the University of California at Berkeley, who in a recent presentation made a strong case for continuing research that she thinks ultimately will lead to genetically modified human embryos, but holding off on actual clinical implementation of findings until we know more. To explain that this would not amount to an alarmist, anti-progressive approach to biotechnology, Doudna points out that a similar ban implemented during the 1970s in connection with molecular cloning, but the ban was designed to allow laboratory research to proceed so that we could gain an better understanding of the safety of the technology before using it for making products that would be used clinically (such as genetically engineered insulin for example).</p>\r\n\r\n<p>As for calls for a moratorium even on research (which would include human embryos that are not viable like those used in the Chinese study), there are people who can make a good case against going to such lengths.&nbsp;As far back as 2013, before the Chinese study,&nbsp;<a href="http://intelligencesquaredus.org/debates/past-debates/item/798-prohibit-genetically-engineered-babies" target="_blank"><em>Intelligence Squared</em></a>&nbsp;hosted a debate in which&nbsp;Nita Farahany, professor of Law and&nbsp;Genome Sciences and policy at Duke, and Lee Silver, professor of molecular biology at Princeton, took a position against a moratorium. They won, at least in terms of being able to change more minds than the team that argued in favor of prohibiting further gene editing work on human embryos.</p>\r\n\r\n<p>Farahany and Silver were able to win based on the idea that in the years to come embryonic editing would not be carried out principally to develop new kinds of human beings, the kind of scenario that worries bioethics experts who speak about the “social dangers” of modifying humans. Rather, their point was that goals of embryonic editing would be modest at least in the foreseeable future.</p>\r\n\r\n<p>Indeed, Farahany made the point that recent successes in mitochondrial transfer (<a href="http://www.sciencemag.org/news/2015/02/uk-parliament-approves-controversial-three-parent-mitochondrial-gene-therapy" target="_blank">where a donor gives mitochondria to an embryo</a>) is in fact a category of embryonic genome editing. Future work involving editing of a small number of genes of the human nuclear genome in embryos could then be as a more ambitious project but not different fundamentally from intervening with an embryo’s mitochondrial genome.</p>\r\n\r\n<p>In contrast to most of the human genome which is located in the cell nucleus, mitochondrial genes are sequences of DNA that is located in energy producing organelles, mitochondria. that are dispersed throughout the cell cytoplasm, outside of the nucleus. Mitochondria contain their own DNA, because their ancestors are thought to have been independent microorganisms. A human being inherits mitochondria only from his or her mother. In rare circumstances, mitochondria are defective. This can make all of a woman’s eggs defective, but with mitochondrial transfer her nuclear genome can be used for in vitro fertilization with a man’s sperm and her mitochondria–along with the mitochondrial genes–replaced with those from a female donor. Essentially, this gives the off spring two mothers and one father, but importantly normally functioning mitochondria.</p>\r\n\r\n<p>Mitochondrial transfer amounts to a major editing job on what becomes an embryo, yet it has led to the birth of apparently normal children. Those children and their parents must live with an uncertainly; it is not possible to be 100 percent sure that the procedure has no long-term consequences. But the children would have been extremely sick without it, or never could have been born at all. This must be taken into account alongside the fact that there are also uncertainties when children are born the natural way.</p>\r\n\r\n<p><strong>Editing the nuclear genome</strong></p>\r\n\r\n<p>If mitochondrial genome transfer is less ambitious type of embryonic gene editing than manipulation of the nuclear genome, what then is an example nuclear gene editing that could make sense clinically given the current state of biotechnology?</p>\r\n\r\n<p>One example might be a case of a monogenetic disease that is detected in an embryo that a parent is not willing to discard, namely one that has already produced a pregnancy. Although currently embryonic gene editing involves making changes to embryos&nbsp;<em>in vitro</em>, eventually it should be possible to utilize CRISPR/CAS or other molecular tools that are sometimes known as “DNA scissors.” There are numerous recessive diseases resulting from a child receiving two defective copies of a gene, one from each parent. Beta-thalassemia is one example; another is Tay Sachs disease. While genetic counseling can reduce the incidence of this type of condition, Tay Sachs is seen more often among ultra-orthodox Jews who marry within a small community. Thus, we can imagine a scenario in which it is detected in utero following normal fertilization (as opposed to IVF) and the parents prefer gene editing to abortion. This situation may be rare, but it could create a pathway to bring embryonic gene editing into clinical use.</p>\r\n\r\n<p><strong>David Warmflash is an astrobiologist, physician and science writer. Follow<a href="https://mobile.twitter.com/cosmicevolution" target="_blank">@CosmicEvolution</a>&nbsp;to read what he is saying on Twitter.</strong></p>\r\n', '', 'full_html'),
('news_events', 0, 11, 11, 'en', 0, '<p>Poverty, Unemployment, Disability has elevated the problem of homelessness in the country to a sky high level. At least 2 million people are homeless in India despite the country growing in global economic stature. There is a shortage of 18.78 million houses in the country. Timothy Pina said that “Homelessness is neither a disease nor a crime, but a very serious problem”. We, the premier institute of education in Central India, wish to bring about the ‘Change’. Change which highlights the plight and pathos of the unfortunate people, change for a better society, change which makes our country a better place for all.</p>\r\n\r\n<p>Let’s join hands in rooting out such social problems and help in giving shelter to all. Let’s get motivated, be socially responsible and proactive in our drive against problems our country faces. We invite you all you to be a part of this mega-change, a mega-event for this cause on 2nd October, 2014 – the birthday of father of Nation – an apt day to cherish our accomplishments and acknowledge the deficiencies. Join us to ‘Run for the Homeless’. Let’s all run for a Beautiful, Better, Brighter India.</p>\r\n', '', 'full_html'),
('news_events', 0, 12, 12, 'en', 0, '<p>IIM Indore brings to you its Annual National Social Fest – Utkarsha.</p>\r\n\r\n<p>‘Utkarsha’ means to ‘to rise’, and that’s exactly the spirit that this fest hopes to capture.</p>\r\n\r\n<p>Utkarsha aspires to bring together local people, industry experts, youth, social organisations, media and visitors from all over India on an annual basis to celebrate our community’s diversity, dynamism and ingenuousness.</p>\r\n\r\n<p>The one-day fest will include the following events:</p>\r\n\r\n<p><strong>NGO-CSR Conclave-</strong></p>\r\n\r\n<p>NGO-CSR Conclave at Utkarsha aims to amass the views and perspectives of NGOs and CSRs towards solving social problems and building a better nation.</p>\r\n\r\n<p><strong>CSR Strategy Competition</strong></p>\r\n\r\n<p>Top minds of the country will battle it out to deliver the best implementable models in the field of CSR.</p>\r\n\r\n<p><strong>Avdhaarna</strong></p>\r\n\r\n<p>Avdhaarna is the flagship social B-Plan competition of Utkarsha. Avdhaarna strives to create a positive societal impact by providing a forum for self sustainable social entrepreneurship plans.</p>\r\n\r\n<p><strong>NGO Mela</strong></p>\r\n\r\n<p>NGO Mela at Utkarsha aims to give a platform to the NGO’s from across the nation to help them to connect to the market through exhibitions.</p>\r\n\r\n<p>Utkarsha 2015 is scheduled on March 8, 2015.</p>\r\n\r\n<p>More information about Utkarsha can be found at:</p>\r\n\r\n<p>www.utkarsha.net.in | https://www.facebook.com/utkarshafest</p>\r\n\r\n<p>Contact details:</p>\r\n\r\n<p>utkarsha@iimidr.ac.in | i13anshumans@iimidr.ac.in | i13satchis@iimidr.a.c.in</p>\r\n', '', 'full_html'),
('news_events', 0, 13, 13, 'en', 0, '<p>IIM Indore brings to you its Annual National Level Sports Festival – Ranbhoomi.</p>\r\n\r\n<p>The word ‘Ranbhoomi’ truly captures the essence of any competitive Sport. It is about the challenge, the war, the performance in the war, the rules, the ethics, the spirit and all that contributes to culminate into a healthy competition where one desires victory, in its every form.</p>\r\n\r\n<p>The three-day event holds an enthralling variety of sporting events – ranging from the popular – Cricket, Football, Basketball, Volleyball &amp; Chess to the unusual including Arm-Wrestling, even! And, each promises to bring together the best talent from across the nation.</p>\r\n\r\n<p>Ranbhoomi brings to you, three days of pure, unadulterated sporting fun. Join in, play hard, compete well, and walk away with laurels and a shining victory that is promised.</p>\r\n\r\n<p>Ranbhoomi 2016 is scheduled from 5th February – 7th February 2016.</p>\r\n\r\n<p>More information can be found at:</p>\r\n\r\n<p>http://www.iimidr.ac.in/news-events/ranbhoomi/ &nbsp; | &nbsp;www.ranbhoomi.com | www.facebook.com/ranbhoomifest</p>\r\n\r\n<p>Contact details:</p>\r\n\r\n<p>ranbhoomi@iimidr.ac.in | ipmsportscom@iimidr.ac.in | ipmsac@iimidr.ac.in</p>\r\n', '', 'full_html'),
('news_events', 0, 14, 14, 'en', 0, '<p>Management is not only taught in closed classrooms but is also learnt through experience and reflection, and every second year student of the PGP programme gets a chance to explore this in the lap of the Himalayas. As the students prepare to assume greater responsibility in life by joining the high ranks of the corporate world, the Himalayas give them the opportunity to reflect on the one and a half year spent in the Institute and the importance of this education in future.</p>\r\n\r\n<h3>The Concept</h3>\r\n\r\n<p>Started in 2010 on a trial basis, this unique course involved just 30 students who were initially sent to Nainital for a week-long excursion. Given the emphatic response of the participants, the course was formally inducted into the second year curriculum as a 4-credit course.</p>\r\n\r\n<p>Every year since then, the programme, coordinated through India hikes, takes place across various popular trek routes like Kedarkantha, Dayara-Barsu , Bedni-Bugyal and Nainital.</p>\r\n\r\n<p>The students go through multiple rounds of training, focusing on adventure sports and real-life challenges, designed to test their managerial and leadership skills. From rock-climbing, rappelling and river rafting, to yoga and pranayama, the Himalayan Outbound Programme offers a mix of physical and psychological experiential tasks for the students.</p>\r\n\r\n<p>To elucidate, the range of activities include basic survival training – cooking competitions, firewood collection, setting up the tent, and various mountain tasks where teams strategize and perform together, which tests their leadership skills and team dynamics. The second leg of training entails engaging the students in social work by helping villages close to the base camps by providing an innovative solution to their basic problems through the application of their classroom learning.</p>\r\n\r\n<p>The training is continuously evaluated by the members of the India Hikes team with each student being graded on process compliance, leadership skill, out-of-the-box thinking, quality of work, initiative, team work, timely completion of tasks and overall capabilities.</p>\r\n\r\n<h3>Benefits to the Participants</h3>\r\n\r\n<p>As mentioned earlier, the students get an opportunity to explore the Himalayas while bonding with their peers before they set out to pursue their managerial careers.</p>\r\n\r\n<p>In addition, the programme sensitizes the participants towards being more aware of their natural surroundings while discovering their own selves in the process.</p>\r\n\r\n<p>All in all, the programme shapes and develops the future managers to face challenges, work in a team, stay rooted to the problem at hand, while living the moment.</p>\r\n\r\n<p>It is a week that remains etched in the minds of all the participants of IIM Indore and teaches them the importance of managing their own self, their strengths as well as their weaknesses before .</p>\r\n', '', 'full_html'),
('pgp_club', 0, 15, 15, 'en', 0, '<p>Children between the age of 6 and 12 years old act as mascots for the Chelsea team before each home and away game.</p>\r\n\r\n<p>A waiting list operates for children to become mascots. New names are added in the order in which applications are received. We have made contact with applicants added in 2009 and will shortly be moving on to those added in 2010.&nbsp;Beyond this, we cannot give a definite wait time.</p>\r\n\r\n<p>The length of the waiting list should be considered when making an application. For instance, a 10-year-old would not currently be added as the child will not reach the top of the list before reaching the age limit.</p>\r\n\r\n<p>When confirmation is sent that a child has been added to the waiting list, it is stated that the club cannot guarantee the top of it will be reached before the age limit.</p>\r\n\r\n<p>There are two Chelsea mascots at our home league fixtures and one at away league fixtures. Mascots are present for cup games as and when permitted by the competition''s sponsor.</p>\r\n', '', 'full_html'),
('pgp_club', 0, 16, 16, 'en', 0, '<p>All the UEFA Champions League round of 16 clubs were permitted to register a maximum of three new eligible A list players by midnight CET on Tuesday 2 February. With that deadline now passed, here are the changes (click on the clubs to view their full squad list).</p>\r\n\r\n<p><a href="http://www.uefa.org/MultimediaFiles/Download/Regulations/uefaorg/Regulations/02/23/57/51/2235751_DOWNLOAD.pdf"><em><strong>The full regulations around player registration can be found here (see Article 44).</strong></em></a></p>\r\n\r\n<p><strong>Headlines</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Aleix Vidal and Arda Turan added to Barcelona squad</li>\r\n	<li>Radamel Falcao makes way at Chelsea as Matt Miazga and Alexandre Pato come in</li>\r\n	<li>In-form Kelechi Iheanacho replaces injured Samir Nasri for Manchester City</li>\r\n	<li>Paris Saint-Germain are the only team to make no changes</li>\r\n	<li>Roma add Stephan El Shaarawy, Ervin Zukanović and Diego Perotti</li>\r\n</ul>\r\n', '', 'basic_html'),
('pgp_club', 0, 17, 17, 'en', 0, '<p>Lions Clubs International, a service membership organization of over 1.4 million members worldwide (as of April 2015), was founded in the<a href="https://en.wikipedia.org/wiki/United_States" title="United States">United States</a>&nbsp;on June 7, 1917, by&nbsp;<a href="https://en.wikipedia.org/wiki/Melvin_Jones_(Lions_Club)" title="Melvin Jones (Lions Club)">Melvin Jones</a>,<sup id="cite_ref-2"><a href="https://en.wikipedia.org/wiki/Lions_Clubs_International#cite_note-2">[2]</a></sup>&nbsp;a&nbsp;<a href="https://en.wikipedia.org/wiki/Chicago" title="Chicago">Chicago</a>&nbsp;businessman. Jones asked, with regard to his colleagues, "What if these men who are successful because of their drive, intelligence and ambition, were to put their talents to work improving their communities?" Jones'' personal code, "You can''t get very far until you start doing something for somebody else," reminds many Lions of the importance of community service.<sup id="cite_ref-3"><a href="https://en.wikipedia.org/wiki/Lions_Clubs_International#cite_note-3">[3]</a></sup></p>\r\n\r\n<p>The Lions motto is "We Serve." Local Lions Club programs include sight conservation, hearing and speech conservation,&nbsp;<a href="https://en.wikipedia.org/wiki/Diabetes" title="Diabetes">diabetes</a>awareness, youth outreach, international relations, environmental issues, and many other programs.<sup id="cite_ref-ldp_4-0"><a href="https://en.wikipedia.org/wiki/Lions_Clubs_International#cite_note-ldp-4">[4]</a></sup>&nbsp;The discussion of politics and religion is forbidden. The LIONS acronym also stands for Liberty, Intelligence, Our Nations'' Safety.</p>\r\n', '', 'full_html');
