INSERT INTO `search_dataset` (`sid`, `langcode`, `type`, `data`, `reindex`) VALUES
(1, 'en', 'node_search', ' iim indore wraps up summer placements 2015 iim indore wraps up summer placements 2015 admin tue 1262016 1144 iim indore boasting of the biggest batch across iims with 562 pgp and ipm participants has wrapped up summer placements for the class of 2017 the average stipend for the batch stood at inr 91000 for 8 weeks an increase of 28 over the last year marquee recruiters asian paints kellogg s mapro foods and microsoft returned to the campus along with bharti axa emc corporation sarda group and xerox india visiting for the first time the highlight of this year was a significant increase in the number of roles and offers by each company the highest stipend was inr 3 lakhs for 8 weeks offered by the boston consulting group and a leading private equity firm bcg cognizant business consulting deloitte s o redseer consulting tcs were some of the prominent recruiters in the consulting domain bfsi domain witnessed offers from investment banks like deutsche bank edelweiss goldman sachs j p morgan whose combined offer count was more than 40 american express arcesium axis bank crisil fidelity investments hsbc icici bank were the other big names the above firms offered diverse roles ranging from investment banking equity research credit analysis retail banking and risk management investment associate role was offered by a private equity company sales and marketing remained one of the most preferred domains amongst the participants with big brands like asian paints britannia dabur hul itc kellogg s l oreal marico pepsico philips pidilite raymond tata steel tolaram group vodafone expressing their faith in the marketing talent at iim indore other prominent recruitment partners include genpact gsk pharma ht media and multi screen media aditya birla group airtel jspl l t mahindra mahindra reliance industries limited robert bosch offered general management roles operations domain was strengthened by significant increase in offers from adani wilmar cummins india maersk philips and vodafone technology and it firms thronged the campus with general electric hul emc corporation offering coveted leadership roles and microsoft recruiting for their sought after program management role mindtree and xerox offered product management roles while capgemini ibm mahindra comviva tcs wipro recruited for a wide range of roles analytics domain continued its strong emergence with increasing number of offers being rolled out by american express ebay google tiger analytics to name a few infibeam purplle and snapdeal were a few other prominent names under the ecommerce sector this year saw funded and nasscom 10000 list startups participating in the process and offering diverse roles in business development digital marketing market research amongst others the second batch of integrated programme in management that appeared for summer placements witnessed participation by leading recruiters like adani wilmar akzonobel britannia deloitte s o genpact hul icici jp morgan l oreal mahindra mahindra to name a few the summer placement process of the 201517 batch with a marked improvement in the number of first time recruiters profiles offered and stipend has been testimonial to the faith in the institute s course pedagogy and quality of students i thank the recruiters for actively participating and offering internships to our pgp and ipm participants prof rishikesha t krishnan director iim indore  ', 0),
(2, 'en', 'node_search', ' ranbhoomi the sports fest of iim indore from february 5 2016 ranbhoomi the sports fest of iim indore from february 5 2016 admin tue 1262016 1153 the most popular annual sports fest of iim indore ranbhoomi organized by the participants of integrated programme in management ipm would be held at the institute from february 57 2016 the word   ranbhoomi  truly captures the essence of any competitive sport it is about the challenge the war the performance in the war the rules the ethics the spirit and all that contributes to culminate into a healthy competition where one desires victory in its every form the second edition of this exciting fest is likely to draw the best sports persons from prestigious colleges across the nation annually held the threeday event this year will again witness more than 20 sporting events ranging from the popular cricket football basketball lawn tennis volleyball chess to the unusual including arm wrestling street football gully cricket foosball and much more flagship events like triathlon power lifting and swimming will also be included in the competition apart from the sport events and various informal events the highlight of the fest would be a mega night on the last day february 7 2016 the last day will have a   fight for glory campaign  to bring to light the suffering sports persons which would also include a footfall of over 8000 and participation from over 80 colleges as a major highlight the guest of honor for this event will be  mr gautam gambhir  the much loved cricketer of our indian cricket team each event promises to bring together the best talent from across the nation and thus the fest brings three days of a pure unadulterated sporting experience for its participants so the pitch is all set the battleground awaits its participants at ranbhoomi 16 interested participants can register at  wwwranbhoomicom  ', 0),
(3, 'en', 'node_search', ' pragati distributes school bags and sweaters to adopted schools pragati distributes school bags and sweaters to adopted schools admin tue 1262016 1158 the social sensitivity cell of iim indore pragati visited the schools adopted by the institute on december 22 2015 and january 19 2016 the schools namely government girls primary schoolumaria government primary school nawada government eg school pigdamber and government primary middle school shramik colonyrau are adopted by the institute as a part of school adopted programme during this visit the members of pragati and a few staff members of the institutes distributed school bags and sweaters to the students a total of 430 students in these schools benefitted from this activity  ', 0),
(4, 'en', 'node_search', ' microsoft campus recruitment drive for 2016 microsoft campus recruitment drive for 2016 campus recruitment hi guys i am looking for some tips from all of you for this recruitment drive admin thu 1282016 1656  ', 0),
(5, 'en', 'node_search', ' cere 2016 cere 2016 admin mon 2012016 1144 introduction the doctoral fraternity of indian institute of management indore committed to creation and dissemination of knowledge takes immense pride and joy in inviting you to the 7th annual conference on excellence in research and education cere to be held from 5th 8 th may 2016 at the premises of the institute at indore the three day conference will also include paper poster presentation doctoral colloquium and workshop by eminent faculty members to encourage young researchers in the field of management the objective of the conference is to promote propagate and diffuse wisdom pertaining to management and auxiliary disciplines that have the potential to transform the world of academia and practitioners this conference aims to invigorate geniuses of myriad backgrounds with curiosity and to facilitate active participation in the perpetual voyage of knowledge creation it provides us with a platform to solemnize the searches for newer horizons of knowledge and to felicitate the sincere endeavors in this respect in order to propel the spirit of exploration the conference also encourages enabling exchange of views nurturing of research potential and identifying emerging areas etc it also aims at instilling aspiration among budding researchers who want to make an impact it will provide the participants a panoramic glimpse of the contemporary management research in india against the global backdrop  highlights of the conference 1 st day keynote address by  sougata ray professor strategic management iimcalcutta 3 rd day keynote address by  phanish puranam professor strategy and organization design insead singapore workshop on academic writing by  charles dhanaraj professor strategy and global leadership imd switzerland workshop on  critical management studies doctoral colloquium  key dates submission of full paper opens 15 th january 2016 submission closes 15 th february 2016 paper acceptance confirmation 15 th march 2016  venue the venue for the conference is the picturesque hilltop campus of the indian institute of management indore in the heart of central india in addition to wellequipped classrooms and seminar halls there are excellent sports facilities including an olympic size swimming pool and stateoftheart gymnasiums indore is wellconnected to all major cities of india and abroad by air road and railways and boasts of several tourist attractions in its surrounding areas  contact us for any queries related to the conference kindly mail  cere2016 iimidracin coordinator pooja batra 91 9431704771 email  f15poojab iimidracin abstract papers suganya balakumar 91 8056107533 email  f15suganyab iimidracin  travel accommodation deepak ranjan 91 9608096927 email  f15deepakr iimidracin point of contact for foreign delegates kakul modani 91 9893264344 email  f15kakulm iimidracin iimi sac requirementspptx requirementsdocx ', 0),
(6, 'en', 'node_search', ' pan iim third pan iim conference pan iim third pan iim conference admin mon 2012016 1148 india the next decade about the conference the third paniim world management conference at iim indore offers an exciting opportunity for professionals academicians policymakers and thought leaders to share their contributions in various disciplines of management preview current research initiate collaborative efforts and grow professional networks spurred on by the success of the conferences in goa 2013 and kozhikode 2014 the indian institutes of management have once again come together to create a forum where the best minds from india and across the world can map the future course of management thought and practice the three day conference organized with support from the ministry of human resource development government of india promises a rich mix of research presentations invited lectures workshops and plenary sessions the resultant synergy is sure to set the tone for a slew of forward thinking ideas growth and development in a fastchanging global environment the last few decades have seen india emerge as one of the fastest growing economies in the world companies from the indian it ites sector are recognized worldwide for their quality and delivery and india is the preferred destination for technology outsourcing prime minister shri narendra modi s recent call to make in india has enthused the industry and focused attention on strengthening the manufacturing sector through innovation and productivity enhancement india remained insulated from the aftershocks of the recent recession stimulating interest in the strength of the indian domestic market and the monetary management practices adopted by india with growth in its semiurban and rural markets signalling a robust growing economy and acceleration in ecommerce adoption redefining markets india is on the threshold of introducing new models of sustainable development the new models of sustainable development can address the demand for new approaches in dealing with problems arising from widening regional differences and intercountry disputes industries and firms across the world are in a state of fluxwith established large companies reinventing themselves to compete with nimble small companies that dominate new technology arenas for countries as well as firms the strategies of yesteryears may not be appropriate in the next decade which calls for new strategies paradigms and practices our focus therefore is on new practices and policies for growth in a volatile uncertain complex and ambiguous vuca environment with a special emphasis on india call for papers submissions of conceptual empirical research papers in management and allied disciplines are invited from academicians students and practitioners for oral and poster presentations authors are encouraged to submit papers on the conference theme and the following sub themes from any functional perspective subthemes competitiveness in manufacturing and services economic growth development inclusiveness international trade and investments financial and capital markets regulation risk management for countries regions and firms emerging forms of businesses and industries strategies for growth in an uncertain environment leadership for the enterprise of tomorrow people management in and uncertain world entrepreneurship and innovation ethical business practices and corporate governance corporate social responsibility global operations and sustainability communication challenges in multicultural organizations engaging with the consumer in a digital world egovernance special interest group tracks   iim indore has launched special interest groups in particular areas of interest to provide faculty and students a forum for collaborative knowledge creation and research we invite research papers pertaining to the following special interest areas rejuvenating msmes doing business in china and india the aviation industry frugal and inclusive innovation economic and social development at the regional level the subthemes mentioned above are only indicative in nature and authors are encouraged to submit papers on topics that dovetail with the theme of the conference papers not directly related to the conference theme but representing cuttingedge management thinking or research methods are also welcome a maximum of three papers single authored coauthored may be submitted by a participant all papers will be subject to blind peer review before acceptance awards selected papers will be considered for awards in the best paper best doctoral student paper and best poster presentation categories selected papers will also be considered for publication in a peerreviewed special issue of the indore management journal extended abstracts of all papers will be made available as part of the conference proceedings  ', 0),
(7, 'en', 'node_search', ' faculty development programme 2016 faculty development programme 2016 admin mon 2012016 1152 introduction aimed at enhancing research and teaching capabilities of management educators iim indore s fdp is a 5week residential programme specially designed for faculty members of management education and training institutes the programme enables the participants to develop competence in understanding recent advances in management research to learn to improve pedagogies and to better presentation skill to become an effective management faculty programme design the primary thrust of the 5week programme will be to equip the participants with contemporary research and teaching skills emphasis will also be given to understanding of philosophy of management design and development of learning resources and so on the course would contain following modules module 1 case and teaching skill development module 2 research methodology module 3 research skill development module 4 perspectives on management for more details please contact fdp office 7312439616 549 or email at  fdp iimidracin aibindiaconferencebrochurepdf ', 0),
(8, 'en', 'node_search', ' isro scientists in ahmedabad use spares for weather satellite to save cost and time isro scientists in ahmedabad use spares for weather satellite to save cost and time admin sat 2062016 1404 a cyclonepredicting satellite being built by isro scientists at the space applications centre sac in ahmedabad could be cited as an example of frugality the new weather satellite being built at 60 per cent of the actual cost and in onethird of the stipulated time is set to replace oceansat2 that had accurately predicted cyclones like hudhud and phailin about 40 per cent parts of this 310 kg satellite scatsat1 which is expected to be launched in july 2016 are literally leftovers from previous satellite missions that have been built at the sac normally it takes about three years to build a satellite of this class from scratch however as we have sourced 40 per cent of the parts used in scatsat1 from spares of previous missions we will complete it in a year s time said tapan misra director of the sac an important arm of isro that deals with a wide variety of disciplines comprising of design and development of payloads societal applications capacity building and space sciences also there is a substantial reduction in the cost of building the satellite we are at least saving 60 per cent of the total cost that s not all when launched in july scatsat1 will be piggyride with another satellite thus saving us the launch costs as well said misra without divulging the cost of the new weather satellite scatsat1 is set to replace oceansat2 which was launched in 2009 and had become dysfunctional in 2014 oceansat2 was famous for its accurate predictions of cyclones like hudhud and phailin currently we are getting most of our weather data from the insat3d satellite he said the new satellite will also have a scatterometer to help it predict cyclogenesis or the formation and strengthening of cyclones in the seas it will measure wind vectors including the direction and speed of wind over seas and oceans this satellite has also been built to withstand multiple system failures unlike the previous weather satellites that were designed for a single failure misra added scatsat1 will have a missionlife of five years and hold fort for isro till a more advanced oceansat3 is built this polar orbiting satellite will take two days to cover the globe and is expected to provide data to other nations see more at http indianexpresscom article cities ahmedabad isroscientistsinahmedabadusessparesforweathersatel sthashzjbpdvcwdpuf  ', 0),
(9, 'en', 'node_search', ' cosmic methanol reactions led to life on earth  cosmic methanol reactions led to life on earth admin sat 2062016 1411 scientists including one of indianorigin have proposed a new set of cosmic chemical reactions involving methanol that may have led to the creation of the first building blocks of life on earth how life began is one of the most fundamental questions scientists puzzle over to address it they have to look not just back to the primordial earth but out into space through experiments and calculations the scientists including surya prakash of university of southern california demonstrated that methanol can give rise to varied hydrocarbons their derivatives and products including their ions carbocations and carbanions which have been observed in outer space the scientists believe that when these hydrocarbons and other products were transported to earth by asteroids or comets they continued to evolve in the planet s unique goldilocks conditions liquid water a breathable atmosphere and moderate temperatures ultimately leading to life as we know it in the earliest minutes of the universe s formation from the energy of the big bang hydrogen and helium formed all of the other elements developed later in the hot interiors of new stars through the nucleochemical transformation of hydrogen into carbon nitrogen oxygen and others a few million years later supernova explosions in these stars flung elements into the surrounding space forming water and hydrocarbons compounds containing carbon and hydrogen such as methane and methanol how more complex hydrocarbons evolved including those that would eventually lead to life on earth remains an open question some astrophysicists propose that they all came from methane which is composed of one carbon atom and four hydrogen atoms the researchers found that methanol an abundant derivative of methane and better known on earth as wood alcohol is more reactive than methane itself the research was published in the journal of the american chemical society  ', 0),
(10, 'en', 'node_search', ' gene editing on human embryos would not create designer babies  gene editing on human embryos would not create designer babies admin sat 2062016 1417 would you edit the genome of your future to child for many people the initial impulse might lead you to say no based on the idea that any benefits could be outweighed by the risks but considering certain classes of genetic conditions it s possible that one s perspective might change it has been almost four years since researchers first demonstrated that clustered regularlyinterspaced short palindromic repeats and associated an endonuclease together known as the crspr cas system could be used for genome editing since that time media discussions of the prospect of utilizing these tools to edit the genomes of human embryos have been influenced heavily by the idea that we should hold off on designer babies critics suggest that it s too dangerous the human genome and gene expression is extremely complex such that meddling could lead to unpredictable consequences despite these concerns researchers are moving forward with attempts to make edits to human embryos using crispr and other genome editing techniques on february 1  regulators in the united kingdom  announced they would allow these times of edits to be done by scientists at the francis crick institute in london the goal of this research is to learn more about the early stages of human life and will not involved implantable embryos but many are beginning to wonder not if  human embryonic genome editing on implantable embryos which could produce heritable changes to the genome but  when  will it happen however recent examples suggest that if they do occur the edits may not be as drastic as some are concerned they will be chinese researchers already accomplished editing of human embryo based on a cautious perspective chinese researchers received strong criticism from around the planet last year for demonstrating that they could edit genomes of 86 human zygotes even though the zygotes used were not viable there was no chance that they d ever be used in a pregnancies going to term so arguably there was no ethical issue  published in the journal  protein and cell  the chinese study was a scientific success the researchers showed that they could replace a defective dna sequence causing betathalassemia theoretically doing the same thing in viable embryos would result in a cure for such a recessive disease if taken to term such an embryo would produce a child with normal hemoglobin despite having received defective genes from both parents of course there are other ways to prevent birth of a child with a recessive disease if an embryo can be tested in the first place to reveal two defective copies of the gene for the hemoglobin beta chain in the first place then the same embryo can be discarded and the parents can try for a new embryo after all two carriers of the mutation have only a 25 percent chance of producing such an diseased embryo surely say critics screening and discarding embryos is less risky than meddling with an embryonic genome that may be a reasonable position but the chinese study was still a remarkable accomplishment scientifically it has potential clinical benefits that should have figured prominently in media coverage but weren t on the normally progressive npr   for instance coverage was skewed in favor of genetics experts who spoke only of the dangers no researcher should have the moral warrant to flout the globally widespread policy agreement against modifying the human germline said marcy darnovsky of the  center for genetics and society  for instance in a quote highlighted by the npr story this paper demonstrates the enormous safety risks that any such attempt would entail and underlines the urgency of working to forestall other such efforts the social dangers of creating genetically modified human beings cannot be overstated another expert cited in the story george daley of harvard said we should brace for a wave of these papers and i worry that if one is published with a more positive spin it might prompt some in vitro fertilization clinics to start practicing it which in my opinion would be grossly premature and dangerous the npr story did not balance such warnings with an appreciation for the potential of such research to lead to life saving therapies even far into the future moreover media have been  taking a similar approach  to the topic over the last two years as if there were no experts to quote who could provide a less alarmist perspective but such experts do exist crspr cas game changer in biomedicine are stories about designer babies missing the boat  the chinese embryonic editing study notwithstanding genome editing technology is currently being used and envisioned for a host of applications less ambitious than embryo tampering but exciting for biomedicine nevertheless beyond numerous research applications that are helping molecular biologists to discover new drugs and other interventions crispr technology is also being studied for modifying stem cells that can be used for all sorts of treatments it also will be used in vivo in adult humans probably first in blood conditions since  in vivo  as well as  in vitro  modification of blood cells is inherently much easier than than editing sequences within cells of solid tissues compared with these applications the prospect of using embryonic modification clinically lies further into the future making media coverage focussing on human embryonic modification appear premature early gene editing of embryos would not make major changes nobody is arguing today that gene editing technology for human embryos is ready for clinical applications in fact several scientists who work with the technology are calling for a moratorium on clinical use of its embryonic applications this camp includes codiscoverer of crispr cas9 the particular crispr cas that occurs naturally in the bacterial species  streptococcus pyogenes  jennifer doudna of the university of california at berkeley who in a recent presentation made a strong case for continuing research that she thinks ultimately will lead to genetically modified human embryos but holding off on actual clinical implementation of findings until we know more to explain that this would not amount to an alarmist antiprogressive approach to biotechnology doudna points out that a similar ban implemented during the 1970s in connection with molecular cloning but the ban was designed to allow laboratory research to proceed so that we could gain an better understanding of the safety of the technology before using it for making products that would be used clinically such as genetically engineered insulin for example as for calls for a moratorium even on research which would include human embryos that are not viable like those used in the chinese study there are people who can make a good case against going to such lengths as far back as 2013 before the chinese study  intelligence squared  hosted a debate in which nita farahany professor of law and genome sciences and policy at duke and lee silver professor of molecular biology at princeton took a position against a moratorium they won at least in terms of being able to change more minds than the team that argued in favor of prohibiting further gene editing work on human embryos farahany and silver were able to win based on the idea that in the years to come embryonic editing would not be carried out principally to develop new kinds of human beings the kind of scenario that worries bioethics experts who speak about the social dangers of modifying humans rather their point was that goals of embryonic editing would be modest at least in the foreseeable future indeed farahany made the point that recent successes in mitochondrial transfer  where a donor gives mitochondria to an embryo  is in fact a category of embryonic genome editing future work involving editing of a small number of genes of the human nuclear genome in embryos could then be as a more ambitious project but not different fundamentally from intervening with an embryo s mitochondrial genome in contrast to most of the human genome which is located in the cell nucleus mitochondrial genes are sequences of dna that is located in energy producing organelles mitochondria that are dispersed throughout the cell cytoplasm outside of the nucleus mitochondria contain their own dna because their ancestors are thought to have been independent microorganisms a human being inherits mitochondria only from his or her mother in rare circumstances mitochondria are defective this can make all of a woman s eggs defective but with mitochondrial transfer her nuclear genome can be used for in vitro fertilization with a man s sperm and her mitochondria along with the mitochondrial genes replaced with those from a female donor essentially this gives the off spring two mothers and one father but importantly normally functioning mitochondria mitochondrial transfer amounts to a major editing job on what becomes an embryo yet it has led to the birth of apparently normal children those children and their parents must live with an uncertainly it is not possible to be 100 percent sure that the procedure has no longterm consequences but the children would have been extremely sick without it or never could have been born at all this must be taken into account alongside the fact that there are also uncertainties when children are born the natural way editing the nuclear genome if mitochondrial genome transfer is less ambitious type of embryonic gene editing than manipulation of the nuclear genome what then is an example nuclear gene editing that could make sense clinically given the current state of biotechnology one example might be a case of a monogenetic disease that is detected in an embryo that a parent is not willing to discard namely one that has already produced a pregnancy although currently embryonic gene editing involves making changes to embryos  in vitro  eventually it should be possible to utilize crispr cas or other molecular tools that are sometimes known as dna scissors there are numerous recessive diseases resulting from a child receiving two defective copies of a gene one from each parent betathalassemia is one example another is tay sachs disease while genetic counseling can reduce the incidence of this type of condition tay sachs is seen more often among ultraorthodox jews who marry within a small community thus we can imagine a scenario in which it is detected in utero following normal fertilization as opposed to ivf and the parents prefer gene editing to abortion this situation may be rare but it could create a pathway to bring embryonic gene editing into clinical use david warmflash is an astrobiologist physician and science writer follow  cosmicevolution  to read what he is saying on twitter ', 0),
(11, 'en', 'node_search', ' indore marathon indore marathon admin sat 2062016 1535 poverty unemployment disability has elevated the problem of homelessness in the country to a sky high level at least 2 million people are homeless in india despite the country growing in global economic stature there is a shortage of 1878 million houses in the country timothy pina said that homelessness is neither a disease nor a crime but a very serious problem we the premier institute of education in central india wish to bring about the change change which highlights the plight and pathos of the unfortunate people change for a better society change which makes our country a better place for all let s join hands in rooting out such social problems and help in giving shelter to all let s get motivated be socially responsible and proactive in our drive against problems our country faces we invite you all you to be a part of this megachange a megaevent for this cause on 2nd october 2014 the birthday of father of nation an apt day to cherish our accomplishments and acknowledge the deficiencies join us to run for the homeless let s all run for a beautiful better brighter india sun 2282016 700  ', 0),
(12, 'en', 'node_search', ' utkarsha utkarsha admin sat 2062016 1547 thu 3032016 1930 iim indore brings to you its annual national social fest utkarsha utkarsha means to to rise and that s exactly the spirit that this fest hopes to capture utkarsha aspires to bring together local people industry experts youth social organisations media and visitors from all over india on an annual basis to celebrate our community s diversity dynamism and ingenuousness the oneday fest will include the following events  ngocsr conclave ngocsr conclave at utkarsha aims to amass the views and perspectives of ngos and csrs towards solving social problems and building a better nation csr strategy competition top minds of the country will battle it out to deliver the best implementable models in the field of csr avdhaarna avdhaarna is the flagship social bplan competition of utkarsha avdhaarna strives to create a positive societal impact by providing a forum for self sustainable social entrepreneurship plans ngo mela ngo mela at utkarsha aims to give a platform to the ngo s from across the nation to help them to connect to the market through exhibitions utkarsha 2015 is scheduled on march 8 2015 more information about utkarsha can be found at wwwutkarshanetin https wwwfacebookcom utkarshafest contact details utkarsha iimidracin i13anshumans iimidracin i13satchis iimidracin  ', 0),
(13, 'en', 'node_search', ' ranbhoomi ranbhoomi admin sat 2062016 1553 fri 3182016 2000 iim indore brings to you its annual national level sports festival ranbhoomi the word ranbhoomi truly captures the essence of any competitive sport it is about the challenge the war the performance in the war the rules the ethics the spirit and all that contributes to culminate into a healthy competition where one desires victory in its every form the threeday event holds an enthralling variety of sporting events ranging from the popular cricket football basketball volleyball chess to the unusual including armwrestling even and each promises to bring together the best talent from across the nation ranbhoomi brings to you three days of pure unadulterated sporting fun join in play hard compete well and walk away with laurels and a shining victory that is promised ranbhoomi 2016 is scheduled from 5th february 7th february 2016 more information can be found at http wwwiimidracin newsevents ranbhoomi wwwranbhoomicom wwwfacebookcom ranbhoomifest contact details ranbhoomi iimidracin ipmsportscom iimidracin ipmsac iimidracin  ', 0),
(14, 'en', 'node_search', ' himalayan outbound programme himalayan outbound programme admin sat 2062016 1555 sat 2202016 700 management is not only taught in closed classrooms but is also learnt through experience and reflection and every second year student of the pgp programme gets a chance to explore this in the lap of the himalayas as the students prepare to assume greater responsibility in life by joining the high ranks of the corporate world the himalayas give them the opportunity to reflect on the one and a half year spent in the institute and the importance of this education in future the concept started in 2010 on a trial basis this unique course involved just 30 students who were initially sent to nainital for a weeklong excursion given the emphatic response of the participants the course was formally inducted into the second year curriculum as a 4credit course every year since then the programme coordinated through india hikes takes place across various popular trek routes like kedarkantha dayarabarsu bednibugyal and nainital the students go through multiple rounds of training focusing on adventure sports and reallife challenges designed to test their managerial and leadership skills from rockclimbing rappelling and river rafting to yoga and pranayama the himalayan outbound programme offers a mix of physical and psychological experiential tasks for the students to elucidate the range of activities include basic survival training cooking competitions firewood collection setting up the tent and various mountain tasks where teams strategize and perform together which tests their leadership skills and team dynamics the second leg of training entails engaging the students in social work by helping villages close to the base camps by providing an innovative solution to their basic problems through the application of their classroom learning the training is continuously evaluated by the members of the india hikes team with each student being graded on process compliance leadership skill outofthebox thinking quality of work initiative team work timely completion of tasks and overall capabilities benefits to the participants as mentioned earlier the students get an opportunity to explore the himalayas while bonding with their peers before they set out to pursue their managerial careers in addition the programme sensitizes the participants towards being more aware of their natural surroundings while discovering their own selves in the process all in all the programme shapes and develops the future managers to face challenges work in a team stay rooted to the problem at hand while living the moment it is a week that remains etched in the minds of all the participants of iim indore and teaches them the importance of managing their own self their strengths as well as their weaknesses before  ', 0),
(15, 'en', 'node_search', ' chelsea club chelsea club admin sat 2062016 1717 children between the age of 6 and 12 years old act as mascots for the chelsea team before each home and away game a waiting list operates for children to become mascots new names are added in the order in which applications are received we have made contact with applicants added in 2009 and will shortly be moving on to those added in 2010 beyond this we cannot give a definite wait time the length of the waiting list should be considered when making an application for instance a 10yearold would not currently be added as the child will not reach the top of the list before reaching the age limit when confirmation is sent that a child has been added to the waiting list it is stated that the club cannot guarantee the top of it will be reached before the age limit there are two chelsea mascots at our home league fixtures and one at away league fixtures mascots are present for cup games as and when permitted by the competition s sponsor  ', 0),
